import React from "react"

import projectData from "../portfolio_data/projectData"
import Project from "./Project"

function MainContentPortfolio(){
    let i = 0;
    const myProjects = projectData.map(function(data){
        let container, h2, p, icon, pos;
        if(i%2 == 0){
            container = "container_gray"
            h2 = "h2_left"
            p = "p_left"
            icon = "icon_left"
            pos = "l"
        }
        else{
            container = "container_white"
            h2 = "h2_right"
            p = "p_right"
            icon = "icon_right"
            pos = "r"
        }
        i++;
        return <Project key={data.id} project={data} container={container} h2={h2} p={p} icon={icon} pos={pos}/>
    })

    return (
        myProjects
    )
}

export default MainContentPortfolio
